import { __decorate } from "tslib";
import __NG_CLI_RESOURCE__0 from "./new-training.component.html?ngResource";
import __NG_CLI_RESOURCE__1 from "./new-training.component.css?ngResource";
import { Component } from '@angular/core';
import { TrainingService } from "../training.service";
import { Subscription } from 'rxjs';
import { UIService } from "../../shared/ui.service";
let NewTrainingComponent = class NewTrainingComponent {
    // exercises: Exercise[] = []
    constructor(trainingService, uiService) {
        this.trainingService = trainingService;
        this.uiService = uiService;
        // exercises: Observable<Exercise[]> =
        //     new Observable();
        this.isLoading = true;
        this.loadingSubscription = new Subscription();
        this.exercises = [];
        this.exerciseSubscription = new Subscription();
    }
    ngOnInit() {
        this.loadingSubscription =
            this.uiService
                .loadingStateChange$
                .subscribe((isLoadingState) => {
                this.isLoading = isLoadingState;
            }, (error) => {
                console.log('error :', error);
            });
        this.exerciseSubscription =
            this.trainingService
                .exercisesChanged
                .subscribe(exercises => {
                this.exercises = exercises;
            }, (error) => {
                console.log('error :', error);
            });
        this.fetchExercises();
        // this.http
        //     .get(
        //         '/api/exercises/'
        //     ).subscribe(result => {
        //         console.log("result: ")
        //         console.log(result)
        // })
        // this.exercises = this.http
        //     .get<Exercise[]>(
        //         '/api/exercises/'
        //     )
    }
    fetchExercises() {
        this.trainingService
            .getAvailableExercises();
    }
    onStartTraining(form) {
        this.trainingService
            .startExercise(form.value.exercise);
    }
    ngOnDestroy() {
        this.exerciseSubscription.unsubscribe();
        this.loadingSubscription.unsubscribe();
    }
};
NewTrainingComponent.ctorParameters = () => [
    { type: TrainingService },
    { type: UIService }
];
